INSERT INTO `settings` (`id`, `app_name`, `logo`, `home_page`, `footer_left`, `footer_middle`, `phone`, `email`, `address`, `from_name`, `from_email`, `smtp_username`, `smtp_password`, `smtp_host`, `smtp_port`, `paystack_live_key`, `paystack_test_key`, `is_paystack_activate`, `copyright`, `social_media`, `privacy_title`, `privacy_policy`, `terms_title`, `terms`, `about_us_title`, `about_us`, `manual_subscription`, `personalized_match`, `friendship_matching`, `profile_alert`, `complete_profile_alert`, `approved_profile_mail`) VALUES
(1, 'Lagosmatchmaker', 'web/images/icons/logo.png', '{\"title\":\"ARE YOU LOOKING FOR THE PERFECT MATCH\",\"body\":\"Lagosmatchmaker, the fastest way to find a Perfect MATCH.....\",\"link\":\"\\/basic\",\"search_bottom\":\"When searching for members, do not fill in the part that says Name unless you know the name of the member you are searching for.\\r\\n\\r\\nNot all search field is required, you can choose to search by age range alone.\"}', '{\"title\":\"About Lagosmatchmaker\",\"body\":\"You Are Just some steps away from finding a great MATCH...\",\"image\":\"web\\/images\\/banner\\/footer_image_60ccee5a641b4.jpg\"}', '{\"title\":\"Signup To Our Newsletter\",\"body\":\"By subscribing to our mailing list you will always be updated with the lastest news from us.\",\"link\":\"\\/basic\"}', '+2348038095991', 'lagosmatchmaker@gmail.com', 'Lekki Phase 1, Lagos Nigeria.', 'lagosmatchmaker', 'info@lagosmatchmaker.com', 'anonyecharles@gmail.com', '$boogie30var30', '587', 'smtp.gmail.com', 'sk_test_829cb2018cd45a554623df18a2203328c0935043', 'sk_test_829cb2018cd45a554623df18a2203328c0935043', 0, 'Copyright lagosmatchmaker © 2021. All Rights Reserved.', '{\"facebook\":\"https:\\/\\/facebook.com\",\"twitter\":\"https:\\/\\/twitter.com\",\"instagram\":\"https:\\/\\/instagram.com\",\"linkedin\":\"https:\\/\\/linkedin.com\",\"youtube\":\"https:\\/\\/youtube.com\"}', 'Privacy policy', 'Privacy is our policy so we don\'t joke with it. We strive to keep all our members identity a secret from all members of the platform.', 'Terms and condition', '<p>\r\n                                                        Our Terms and Conditions are as follows:</p><ul><li>Do not ask for favours from other members.</li></ul>', 'About Lagosmatchmaker', '<p class=\"MsoNormal\">Lagosmatchmaker would like to introduce our in-house dating\r\ncoach, Didi. She is the first United States Certified and award winning dating\r\ncoach in Nigeria. She has been matchmaking for over 8 years but got her\r\ncertification from the United states in 2015. The platform Lagosmatchmaker was\r\ncreated as a need for privacy in this dating age. It is a privacy focused\r\nmatchmaking platform for singles over 25years to meet like minded individuals.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">She has her first degree in Economics from the prestigious\r\nHoward University in Washington, DC and her masters in international strategy\r\nfrom University of St-andrews, Scotland. She is also in the process of\r\nobtaining her Phd from University of Plymouth on external debt management. She\r\nalso works as a statistician for National bureau of statistics and has\r\npreviously worked as a strategist for NEXIM Bank and a data analyst with Debt\r\nmanagement office. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">She is an author and her books can be purchased on barnes\r\nand noble, amazon and other online book stores. Her first book is titled:\r\nExamining July 2004 banking sector reform and her second book is titled: Roller\r\ncoaster: the external debt journey so far- Nigeria. She is also a member of\r\nICAN and PDMI. Being an Economist has made her focused on being a part of\r\neconomic growth through the gross domestic happiness which is a measurement\r\nindicator for economic performance used by countries like France, Bhutan and UK\r\nbecause it is expected that happy people are more productive and efficient. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">She decided to go into matchmaking because she intends to be\r\na vessel to happiness and positively affect economic growth. she has a passion\r\nfor matchmaking and her certification in data analysis from the value fronteria\r\nhas been surprisingly useful in the business of matchmaking.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">She has been interviewed on various platforms like BBC world\r\nnews with Phillipa Thomas, Arise news, Reuters, EOM business network on\r\nSilverbird tv, Ebony Life TV, Pursuits by Business day, Techpointng, TVC\r\nnetwork, Nigerian Tribune, The Sun, Businessday, Vanguard, STV, Thisday,\r\nGuardian, URock magazine, the Spice tv africa, Savvymedia Africa, VL magazine\r\nafrica, Jasmine Africa Magazine, the daily times, Africa business radio, News\r\ntelegraph paper, glamtush.com, news time africa, Vanguard allure, Women of rubies,\r\nThe anazons on radio by classic fm, Mumpreneur, HOTM tv by Omilola Oshikoya,\r\nurban woman magazine, Leadership paper, drive magazine, Zamari tv, the hanging\r\nout tv on NTA, Biscon tv, lost in lagos magazine and more. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">She has also spoken on various platforms. Some of which\r\ninclude 53 extra on ebonylife tv, the What women want program with mimi\r\nonalaja, the Sapiosexual club event, JCI Ikeja Business event, femalepreneurs,\r\nlost in lagos, leading ladies foundation, Olahtv, standingout with pat tv, metrowoman,\r\nfearless female network, womens connect, her network, the boss lady conference\r\nseries, the thursdays love match show on classic fm and more.<o:p></o:p></p>', '{\"image\":[\"web\\/images\\/icons\\/bank_icon_60d3984313714.jpeg\"],\"descriptions\":[\"Make payment to 0108125868 Arit Gtbank\",\"After successful payment, Contact  08038095991 via whatsapp\",\"Send prove of payment via the same whatsapp number\",\"Once payment has been confirmed, your account gets approved immediately.\",\"Note: For Premium Members Only \\\" fake ID upload will result to ban from the website and  payment is not refundable\\\"\"]}', '{\"title\":\"Personalized Matching\",\"head\":\"Contact for price\",\"descriptions\":\"Personalize your matching process with the help of an actual LMM staff.\\r\\n\\r\\nContact 08038095991 via whatsapp for the other members in this level.\",\"is_feature\":1}', '{\"title\":\"Friendships Only\",\"head\":\"Contact for price\",\"descriptions\":\"moved to a new town? Looking fir friends with similar values? Looking to expand your social circle?\\r\\n\\r\\nThen join any of our friendship groups. We have the business group, Brunch group, Fitness group, Night hangout group, Travel group, Single mums group, Single dads group.\\r\\n\\r\\nFemales, send a message on instagram to @findafriend.ng or whatsapp 08097205273\\r\\n\\r\\nMales, send a message on instagram to @findabuddy.nig or whatsapp 09064268213\",\"is_feature\":1}', 'complete your profile details to be approved by lagosmatchmaker', 'Congratulations, your account has been approved. you can now match and find love.', 'Congratulations, your account has been approved by Lagosmatchmaker. you can now match, chat and find love on  Lagosmatchmaker.');
